static BatchedListEntries<ZoneReencryptionStatus> listReencryptionStatus(
    final FSDirectory fsd, final long prevId)
    throws IOException {
  fsd.readLock();
  try {
    return fsd.ezManager.listReencryptionStatus(prevId);
  } finally {
    fsd.readUnlock();
  }
}
